        /// <summary>
        /// Decrypts a packet and returns the payload of the packet.
        /// </summary>
        /// <param name="packet">Packet data as a byte array</param>
        /// <returns></returns>
        public static byte[] decrypt(byte[] packet)
        {
            ushort key = packet[2];
            key &= 0x0F;
            key <<= 8;

            var send = new List<byte>();

            for (int i = 9; i < packet.Length; i++)
            {
                int rank = packet[i] + key;
                char c = (char)g_DecTable[rank];
                send.Add((byte)c);
            }

            return send.ToArray();
        }


        /// <summary>
        /// Appels's standard CRC16 implementation
        /// Based on a disassembly of the original server with optimizations
        /// </summary>
        /// <param name="data">Data to CRC as a byte array</param>
        /// <param name="size">Size of the data being CRC'd</param>
        /// <returns></returns>
        public static ushort CalcCRC16(byte[] data, ushort size)
        {
            ushort result = 0, offset = 0;
            do result = (ushort)(result << 8 ^ mTbl[result >> 8 ^ (data[offset++] & 0xFF)]); while (--size > 0);
            return result;
        }

        /// <summary>
        /// Packet encryption/creation method
        /// </summary>
        /// <param name="packetid">Packet header as byte array</param>
        /// <param name="packet">Packet payload as byte array</param>
        /// <returns></returns>
        public static byte[] encrypt(byte[] packetid, byte[] packet)
        {
			ushort len = (ushort)(packetid.Length + packet.Length + 4);

            var mergedpkt = new byte[packetid.Length + packet.Length];
            packetid.CopyTo(mergedpkt, 0);
            packet.CopyTo(mergedpkt, packetid.Length);

            ushort crc = CalcCRC16(mergedpkt, (ushort)mergedpkt.Length);

            var send = new List<byte>();

            foreach (byte b in BitConverter.GetBytes(len))
            {
                send.Add((byte)b);
            }

            byte[] bcrc = BitConverter.GetBytes(crc);

            foreach (byte b in bcrc)
            {
                string tsb = b.ToString("x").ToUpper();
                if (tsb.Length == 1)
                {
                    tsb = "0" + tsb;
                }
            }

            if (!BitConverter.IsLittleEndian)
                Array.Reverse(bcrc);

            ushort bkey = bcrc[0];
            bkey &= 0x0F;
            bkey <<= 8;

            foreach (byte b in bcrc)
            {
                send.Add((byte)b);
            }

            foreach (byte b in packetid)
            {
                send.Add((byte)b);
            }

            for (int i = 0; i < packet.Length; i++)
            {
                int rank = packet[i] + bkey;
                char c = (char)g_EncTable[rank];
                send.Add((byte)c);
            }

            return send.ToArray();
        }
    }
